import React from 'react';


function Cart() {

    function cartItemLoad() {
        let cartItemsArr = JSON.parse(localStorage.getItem('currentCart'));
    }

    return (
        <>
            <div id='cartSpace'>
                <h1>Cart Items</h1>
                
                <div id='cartItems' onLoad={cartItemLoad()}></div>
                
            </div>
        </>
    )
}

export default Cart;
